:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Marianne and DAVIES, Christopher Pearson
  JDAVIES, Marianne Caroline and BUSBY, William
  JBUSBY, Eleanor Maud (Lena). and JEFFERD, Frederic Reader
  JJEFFERD, Janet Mary and MONCKTON, Christopher Martin
  UD Y
  LL
  01> JEFFERD, Janet Mary m on 01.09.1945 to MONCKTON, Christopher Martin
  b 25.05.1918
  b 27.01.1916
  Janet b. at Hornchurch, England and m. at Tokomaru Bay. Christopher, s/o Edward Martin Monckton and
  Grace Iris Lane, b. at Gisborne. Address: 14 Liston Avenue, Taupo.
  Christopher is a retired farmer from the Gisborne district. During WW2 he served with the 2nd NZEF in
  the Middle East and Italy.
  01> MONCKTON, John Jefferd m on 16.02.1968 to MASON, Bronwynne Yvonne
  b 06.07.1946
  b 16.05.1948
  John b. at Gisborne and m. at Nga Tawa, Marton. Bronwynne, d/o George Lethbridge Mason and
  Merle-Aimee Palmer-Jones, b. at Wanganui. Address: Omaha, RD 2, Marton.
  John was educated at Huntley School, Marton, and Gisborne Boys' High School where he played in the
  1st cricket XI and won colours. He was master of the Poverty Bay Hunt Club for three years and
  served on the committee of the Poverty Bay Turf Club. He moved to Rangitikei in 1990 and is now on
  the committee of the Marton Turf Club.
  Bronwynne was educated at Nga Tawa School where she was captain of the basketball team and won
  school colours. She then worked in the ANZ Bank in Palmerston North for two years before her
  marriage. She has a keen interest in horse shows and hunting and is a member of the Rangitikei
  Hunt Club. She also enjoys gardening and sewing.
  Refer to "The Family of Thomas and Jane Mason of Taita" published by Evagean Publishing in 1994 for
  records of Bronwynne's family.
  01> MONCKTON, Mark Mason
  b 21.10.1969
  Mark b. at Gisborne. Address: Pukemarama Farm, RD 3, Palmerston North,
  Mark was educated at Ngatapa Primary School and Wanganui Collegiate School where he gained a
  Bursary, was captain of rowing and cox for two years and won colours. He won the Maadi Cup for
  rowing in 1985 and 1986. He was a keen show jumper and now plays polo (he was a member of the
  New Zealand Colts polo team in 1993). After two years at Victoria University he went to the UK
  where he played polo for two seasons. He now works for the McKelvie family and plays polo for
  Rangitikei.
  02> MONCKTON, Susan Jan
  b 03.08.1973
  Susan b. at Gisborne. She was educated at Ngatapa Primary School and Nga Tawa School, Marton.
  She was captain of the cross-country team and a member of the athletics, cricket and netball
  teams, deputy head of games, head of house and a school prefect and she won colours in
  cross-country and netball. Since leaving school she has spent two years working with horses,
  show jumping and hunting. She had three months in Japan teaching riding and training show
  jumpers. She then attended the Palmerston North College of Education to train as a primary
  school teacher.
  02> MONCKTON, Andrea m on 13.03.1971 to (1) FELL, Anthony John
  b 02.11.1948
  b 14.03.1944
  Andrea b. and m, at Gisborne. Divorced. Anthony b, at Palmerston North,
  01> FELL, Jonathan Monckton
  b 14.06.1972
  Jonathan b, at Palmerston North.
